import React from 'react';

const Footer: React.FC = () => (
  <footer style={{
    background: '#22223b',
    color: '#fff',
    textAlign: 'center',
    padding: '24px 0',
    marginTop: 48
  }}>
    <div style={{ display: 'flex', alignItems: 'center', flexDirection: 'column', marginBottom: 8 }}>
      <img src="/images/profile.jpeg" alt="Profile" style={{ width: 48, height: 48, borderRadius: '50%', objectFit: 'cover', marginBottom: 6, border: '2px solid #22223b' }} />
      <div style={{ fontWeight: 600, fontSize: '1.1rem' }}>Bolaji Onatunde</div>
    </div>
    <div>Email: <a href="mailto:your.email@example.com" style={{ color: '#c9ada7' }}>your.email@example.com</a></div>
    <div>Phone: <a href="tel:+1234567890" style={{ color: '#c9ada7' }}>+1 234 567 890</a></div>
    <div>Address: 123 Main Street, City, Country</div>
  </footer>
);

export default Footer;
